INSERT INTO `respostas` (`RES_id`, `RES_texto`, `RES_data`, `RES_visivel`, `PRO_id`, `USU_id`) VALUES
(14, 'É importante questionar o quanto a expansão dos mercados mundiais exige a precisão e a definição da gestão inovadora da qual fazemos parte. A prática cotidiana prova que o julgamento imparcial das eventualidades maximiza as possibilidades por conta dos níveis de motivação departamental. Evidentemente, a adoção de políticas descentralizadoras pode nos levar a considerar a reestruturação dos paradigmas corporativos.', '2021-08-28 18:11:39', 1, 24, 2),
(15, 'A nível organizacional, a revolução dos costumes agrega valor ao estabelecimento do retorno esperado a longo prazo. Do mesmo modo, o fenômeno da Internet auxilia a preparação e a composição dos conhecimentos estratégicos para atingir a excelência. ', '2021-08-28 18:12:07', 1, 24, 2),
(16, 'Acima de tudo, é fundamental ressaltar que a necessidade de renovação processual deve passar por modificações independentemente do remanejamento dos quadros funcionais. Por conseguinte, a constante divulgação das informações não pode mais se dissociar do sistema de formação de quadros que corresponde às necessidades. ', '2021-08-28 18:12:34', 1, 24, 2),
(17, ' O que temos que ter sempre em mente é que a percepção das dificuldades ainda não demonstrou convincentemente que vai participar na mudança das novas proposições. No entanto, não podemos esquecer que o acompanhamento das preferências de consumo estimula a padronização das formas de ação. O incentivo ao avanço tecnológico, assim como o início da atividade geral de formação de atitudes é uma das consequências do sistema de participação geral. A certificação de metodologias que nos auxiliam a lidar com a determinação clara de objetivos faz parte de um processo de gerenciamento do remanejamento dos quadros funcionais.', '2021-08-28 19:04:46', 1, 26, 2),
(18, 'Já conseguiu ver pra mim? O caminhão ta aki esperandooo', '2021-08-28 19:05:17', 1, 26, 2),
(19, ' importante questionar o quanto o acompanhamento das preferências de consumo agrega valor ao estabelecimento das diretrizes de desenvolvimento para o futuro. ', '2021-09-04 13:35:44', 1, 24, 2),
(21, '<p><strong>Bom dia;</strong></p><p>Por gentileza informar com prints e enviar mais detalhes sobre sua ocorrência para que possamos avaliar melhor.</p><p><strong>Obrigado.&nbsp;</strong></p>', '2021-10-03 22:46:24', 1, 33, 7),
(23, '<p><strong>Olá Jhon Snow</strong></p><p>Como está o reino do norte? Espero que tudo bem.</p><p>Seu protocolo está sendo avaliado pelo departamento técnico. Em breve você receberá a resposta através deste sistema e também pelo seu email.</p><p>Obrigado.</p>', '2021-10-04 00:03:07', 1, 28, 1),
(24, '<p>investigação</p>', '2021-10-05 11:40:56', 1, 25, 1);

